import React from "react";
import Arrdata from "./Arrdata";
const Arrstr = () => {
console.log(Arrdata)
  return (
<>
<Arrdata 
mname={Arrdata[0].mname}
mimg={Arrdata[0].mimg}
mimdb={Arrdata[0].mimdb}
mlink={Arrdata[0].mlink}

/>
<Arrdata 
mname={Arrdata[1].mname}
mimg={Arrdata[1].mimg}
mimdb={Arrdata[1].mimdb}
mlink={Arrdata[1].mlink}
/>
</>  
)
}

export default Arrstr
